       {image: "https://bit.ly/3PpfSsX", title: "Pen 1", text: "great for farting"},
       {image: "https://bit.ly/3PpfSsX", title: "Pen 2", text: "fart"},
       {image: "https://bit.ly/3PpfSsX", title: "Pen 3", text: "fang pi"},
       {image: "https://bit.ly/3PpfSsX", title: "Pen 4", text: "asian buttcrack"},
   ];

   const renderCard = (card, index) => {
       return(
        <Card style={{ width: '18rem' }} key={index}>
        <Card.Img variant="top" src="holder.js/100px180" src={card.image} />
        <Card.Body>
            <Card.Title>{card.title}</Card.Title>
            <Card.Text>
                {card.text}
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
            </Card.Body>
      </Card>
       );
   };


    return <div className = "App">

        {cardInfo.map(renderCard)}</div>;
};

export default Blog
